import React from 'react'
import { Card, Icon } from 'semantic-ui-react'

const extra = (
    // eslint-disable-next-line
  <a>
    <Icon name='star' />
    Add To Favorites
  </a>
)

const Item = () => (
    <Card
    fluid
    image='https://www.sciencenews.org/wp-content/uploads/2018/02/020118_SM_polar-bear_main.jpg'
    extra={extra}
    header='Elliot Baker'
    meta='Friend'
    description='Elliot is a sound engineer living in Nashville who enjoys playing guitar and hanging with his cat.'

  />
)

export default Item
